data[797] = [];
data[797][0] = [];
data[797][0][0] = "chúa_kitô";
data[797][0][1] = "";
data[797][0][2] = "";
data[797][0][3] = "The cross of Christ bears the suffering and the sin of mankind, including our own.";
data[797][0][4] = "Thập giá Chúa Kitô mang đau khổ và tội lỗi của nhân loại, nghĩa là của chúng ta nữa.";
data[797][1] = [];
data[797][1][0] = "chúa_kitô";
data[797][1][1] = "";
data[797][1][2] = "";
data[797][1][3] = "Thus God has fulfilled Satyavrata’s boon.";
data[797][1][4] = "Nhờ thế họ là chi thể sống động của thân thể Chúa Kitô.";
data[797][2] = [];
data[797][2][0] = "chúa_kitô";
data[797][2][1] = "";
data[797][2][2] = "";
data[797][2][3] = "Thanks to the Eucharist, man truly becomes what he eats: the body of Christ!";
data[797][2][4] = "Nhờ Thánh Thể, con người thực sự trở thành điều mình ăn tức là thân thể Chúa Kitô.";
data[797][3] = [];
data[797][3][0] = "chúa_kitô";
data[797][3][1] = "";
data[797][3][2] = "";
data[797][3][3] = "The Psalmist calls us to “worship the Lord in the splendor of holiness.”";
data[797][3][4] = "Đức Thánh Cha cầu xin Chúa Kitô “làm cho chúng ta tăng trưởng trong đức tin.”";
data[797][4] = [];
data[797][4][0] = "chúa_kitô";
data[797][4][1] = "";
data[797][4][2] = "";
data[797][4][3] = "Why would the disciples (or anyone else) want to risk their lives to steal Christ's body?";
data[797][4][4] = "Tại sao các môn đệ (hoặc có ai khác) liều lĩnh cuộc sống để đánh cắp xác Chúa Kitô?";
data[797][5] = [];
data[797][5][0] = "chúa_kitô";
data[797][5][1] = "";
data[797][5][2] = "";
data[797][5][3] = "(The sacrifice of Christ allows the salvation of an obedient humanity to God (John 3:16,36))";
data[797][5][4] = "(Sự hy sinh của Chúa Kitô cho phép sự cứu rỗi của nhân loại (Giăng 3:16))";
data[797][6] = [];
data[797][6][0] = "chúa_kitô";
data[797][6][1] = "";
data[797][6][2] = "";
data[797][6][3] = "Lets look at the serpent, at the poison, there, in the body of Christ.";
data[797][6][4] = "Hãy nhìn vào con rắn, hãy nhìn vào nọc độc nơi thân xác Chúa Kitô.";
data[797][7] = [];
data[797][7][0] = "chúa_kitô";
data[797][7][1] = "";
data[797][7][2] = "";
data[797][7][3] = "with God's holy ones in the one body.";
data[797][7][4] = "Thân Thể của Chúa Kitô trong đó một người";
data[797][8] = [];
data[797][8][0] = "chúa_kitô";
data[797][8][1] = "";
data[797][8][2] = "";
data[797][8][3] = "We should all unite behind Tulsi.";
data[797][8][4] = "Tất cả chúng ta phải cùng nhau nương tựa Chúa Kitô.";
data[797][9] = [];
data[797][9][0] = "chúa_kitô";
data[797][9][1] = "";
data[797][9][2] = "";
data[797][9][3] = "Actually, Christ was quoting the Old Testament—Psalm 37:11 states exactly the same thing.";
data[797][9][4] = "Trên thực tế, Chúa Kitô đã trích dẫn Cựu Ước – Tv 37,11 cũng nói y như thế.";
data[797][10] = [];
data[797][10][0] = "chúa_kitô";
data[797][10][1] = "";
data[797][10][2] = "";
data[797][10][3] = "But what does our Lord’s parable teach us?";
data[797][10][4] = "Thương tích của Chúa Kitô dạy ta cái gì?";
